import React from 'react';
import { Panel, PanelGroup, Paragraph } from 'rsuite';

export default function(){
    return(
        <PanelGroup>
    <Panel header="Panel 1">
      <Paragraph />
    </Panel>
    <Panel header="Panel 2">
      <Paragraph />
    </Panel>
    <Panel header="Panel 3">
      <Paragraph />
    </Panel>
  </PanelGroup>
    );
}
